// frontend/src/App.js
import {Route, BrowserRouter as Router, Routes } from 'react-router-dom'
import Home from './Pages/Home';
import PackagesPage from './Pages/PackagesPage';
function App() {

  return (
   <Router>
    <Routes>
    <Route path='/' element={<Home />} />
    <Route path='/packages' element={<PackagesPage />} />
    </Routes>
   </Router>
  );
}

export default App;
